    false,nt"url": null,nt"notes": "Hourly measurements made by selected ship
    sensors on the R/V Seward Johnson during the "Life on the Edge 2005" expedition
    sponsored by the National Oceanic and Atmospheric Administration (NOAA) Office of
    Ocean Exploration, October 16 through November 4, 2005. Measurements include ship's
    position and heading, air temperature, relative humidity, barometric pressure, wind
    speed and direction, water depth, total solar irradiance, chlorophyll-a (fluorometer),
    sea surface temperature, and salinity. This data set was compiled from Virtual Instrument
    Data System (VIDS) ASCII files provided by the University of Miami Marine Technology
    Group at Harbor Branch Oceanographic Institution.",nt"owner_org": "9cda5205-d632-4814-96e7-a4ab5e0dce85",nt"extras":
